import SignUp from '../components/signup';
import { makeStyles } from '@material-ui/styles';

const useStyles = makeStyles({
	root : {
		maxWidth : '50%',
		padding : '20px 5px',
		margin : '0 auto'
	}
});
export const Register = () => {
	const classes = useStyles();

	return (
		<div className={classes.root}>
			<SignUp />
		</div>
	);
};
